                dd_cache7 += jk.j_factor * dm[(l0+0)*nao+(k0+1)] * dm[(j0+0)*nao+(i0+1)];
                dd_cache8 += jk.j_factor * dm[(l0+0)*nao+(k0+1)] * dm[(j0+0)*nao+(i0+2)];
