                dd_cache10 += jk.j_factor * dm[(l0+0)*nao+(k0+1)] * dm[(j0+0)*nao+(i0+4)];
                dd_cache11 += jk.j_factor * dm[(l0+0)*nao+(k0+1)] * dm[(j0+0)*nao+(i0+5)];
                dd_cache12 += jk.j_factor * dm[(l0+0)*nao+(k0+2)] * dm[(j0+0)*nao+(i0+0)];
                dd_cache13 += jk.j_factor * dm[(l0+0)*nao+(k0+2)] * dm[(j0+0)*nao+(i0+1)];
                dd_cache14 += jk.j_factor * dm[(l0+0)*nao+(k0+2)] * dm[(j0+0)*nao+(i0+2)];
