                dd_cache11 += jk.k_factor * (dm[(j0+0)*nao+(k0+1)]*dm[(i0+5)*nao+(l0+0)] + dm[(j0+0)*nao+(l0+0)]*dm[(i0+5)*nao+(k0+1)] + dmb[(j0+0)*nao+(k0+1)]*dmb[(i0+5)*nao+(l0+0)] + dmb[(j0+0)*nao+(l0+0)]*dmb[(i0+5)*nao+(k0+1)]);
                dd_cache12 += jk.k_factor * (dm[(j0+0)*nao+(k0+2)]*dm[(i0+0)*nao+(l0+0)] + dm[(j0+0)*nao+(l0+0)]*dm[(i0+0)*nao+(k0+2)] + dmb[(j0+0)*nao+(k0+2)]*dmb[(i0+0)*nao+(l0+0)] + dmb[(j0+0)*nao+(l0+0)]*dmb[(i0+0)*nao+(k0+2)]);
